import React from 'react';

export const CreatePasswordcomponent = ({ 
    password,
    setPassword,
    passwordPlaceholder,
    lastNamePlaceholder,
    handlepasswordClick,
    handlepasswordBlur,
    handleConfirmClick,
    handleConfirmBlur,
    handleNextClick
}) => {

    return (
        <form>

            <h1 class="thin h1-space">Create a strong password</h1>

            <h2 class='thin gap'>Create a strong password with a mix of letters, numbers and symbols</h2>

            <label class="space line-height label-input-width input-label">
                <input 
                    class="input"
                    type='password' 
                    value={password} 
                    onChange={(e) => setFirstName(e.target.value)} 
                    placeholder={firstNamePlaceholder}
                    onFocus={handleFirstNameClick}
                    onBlur={handleFirstNameBlur}
                />
            </label>
     
            <label class="space line-height label-input-width input-label">
                <input 
                    class="input disable-eye-icon"
                    type='text'
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    placeholder={lastNamePlaceholder}
                    onFocus={handleLastNameClick}
                    onBlur={handleLastNameBlur}
                />
            </label>
            
            <div class='button-right'>
                <button class="button-space blue-button" onClick={handleNextClick}>
                    Next   
                </button>
            </div>

        </form>
    );
}
